import axios from "axios";

const endPointURL = process.env.REACT_APP_API_URL;

export const fetchLeadsList = async () => {
	try {
		const { data = [] } = await axios.get(
			`${endPointURL}/api/leads/?location_string=India`
		);
		return data;
	} catch (error) {
		return error;
	}
};

export const addLeadService = async (payload) => {
  const { first_name, last_name, mobile, email, location_type, location_string } = payload
  console.log('payload--', payload);
  try {
    const response = await axios.post(`${endPointURL}/api/leadasds/`, {
      first_name,
      last_name,
      mobile,
      email,
      location_type,
      location_string
    })
  } catch (error) {
   return error
  }
}
